import React from 'react';

interface Props {
  nowValue: number;
  maxValue: number;
}

const ViewrSlider: React.FunctionComponent<Props> = ({ nowValue = 0, maxValue }) => {
  console.log();
  return (
    <>
      {
      maxValue
      && <input type="range" min="0" max={maxValue} value={nowValue} />
    }
    </>
  );
};

export default ViewrSlider;
